import React from 'react'
import { socialMedia } from './data'


function App() {

  return (
    <div>
      {socialMedia.map((link) => {
        return (
          <li key={link.id}>
            <a href={link.href}>
              {link.text}</a>
          </li>
        )
      })}
    </div>
  )
}

export default App





